import React from 'react';
import './App.css';



function App(props) {
  const content = props.PRODUCTS.map(p=>{
    <div key={p.id}>
      <h3>{p.category}</h3>
    </div>
  })
  return (
    <div>
    <hr />
    {content}
  </div>
  );
}

export default App;
